import { useNavigate, useParams } from "react-router-dom";

import NavContainer from "../Nav/NavContainer";
import SBContainer from "../SearchBar/SBContainer";

const ProductDetail = ({ handleProductClicked, urlTotalArray }) => {
  const { id } = useParams();
  const navigate = useNavigate();

  const clickedProduct = urlTotalArray.filter((it) => {
    console.log(`it.id = ${it.id}`);
    console.log(`page's id is ${id}`);
    return it.id == id;
  });

  console.log(clickedProduct);
  return (
    <div>
      상품 상세 페이지
      <button
        onClick={() => {
          handleProductClicked();
          navigate(-1);
        }}
      >
        뒤로가기
      </button>
      <div>
        <NavContainer></NavContainer>
        <SBContainer></SBContainer>
        <div className="ProductDetailBodyContainer">
          <div className="ProductDetailBody">
            <div className="ProductDetailOption">
              <div>
                <div>
                  <img src="https://m.bunjang.co.kr/pc-static/resource/f1f8a93028f0f6305a87.png">
                    홈
                  </img>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductDetail;
